import React from 'react';
import { useNavigate } from 'react-router-dom';
import './BackTab.scss';

const BackTab = ({ title }) => {
  const navigate = useNavigate();

  const onBackClick = () => {
    navigate(-1); // -1 = go back
  };

  return (
    <div className="back-tab" onClick={onBackClick}>
      ‚Üê {title}
    </div>
  );
};

export default BackTab;
